import { useEffect } from 'react';
import { Icon, ListItem } from '@mui/material';
import PropTypes from 'prop-types';

function Row({ data, index, style }) {
  const { itemsArray, handleOpenDialogRecordDetailsLogAnalysis, style: classes, array } = data;
  const row = itemsArray[index];
  const optionsDateTimeLine = {
    hour: '2-digit',
    minute: '2-digit',
    second: '2-digit',
    hour12: false,
  };

  useEffect(() => {
    console.log('ROW', row);
  }, [row]);
  return (
    <ListItem
      key={row.name}
      sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
      onClick={() => {
        handleOpenDialogRecordDetailsLogAnalysis(row, index);
      }}
      style={style}
    >
      <div align="center">{index + 1}</div>
      <div>
        {row.flag === 'NULL' ? (
          <Icon>chat_bubble_outline</Icon>
        ) : (
          <Icon className={`${classes[row.flag]}`}>chat_bubble</Icon>
        )}
      </div>

      <div>{row.dateTime}</div>
      <div>{row.doorState}</div>
      <div align="center">{row.fdpentr}</div>
      <div align="center">{row.fdpexit}</div>
      <div align="center">{row.bdpentr}</div>
      <div align="center">{row.bdpexit}</div>
      <div align="center">{row.location}</div>
      <div align="center">{row.dop}</div>
    </ListItem>
  );
}
Row.propTypes = {
  index: PropTypes.number.isRequired,
  data: PropTypes.object.isRequired,
  style: PropTypes.object.isRequired,
};

export default Row;
